    name: "Butter Paneer",
    description:
      "Rich & Creamy curry made with paneer, spices, onions,tomatoes,cashew and butter",
    price: 300.5,
  },
  {
    id: "m2",
    name: "Fried Rice",
    description: "Special Rice made with veggies",
    price: 256.76,
  },
  {
    id: "m3",
    name: "Dal Makhani",
    description:
      "Black Lentils & Red Kidney Beas cooked with spices, butter & cream",
    price: 250.55,
  },
  {
    id: "m4",
    name: "Chilli Chicken",
    description: "Crispy Fried Chicken mixed in spicy gravy",
    price: 398.99,
  },
];

